import React from "react";
import "./CardItem.scss";
import {
  LibraryShelve,
  BooksStack,
  BooksFill,
} from "../../../components/logo/BookLogo";
const CardItem = (props) => {
  const { item } = props;
  let logo = null;
  if (item.logo === "LibraryShelve") {
    logo = <LibraryShelve />;
  } else if (item.logo === "BooksStack") {
    logo = <BooksStack />;
  } else if (item.logo === "BooksFill") {
    logo = <Books />;
  }
  return (
    <div className="card card-md">
      {logo}
      <span className="label">{props.item.label}</span>
      <span className="value">{props.item.value}</span>
    </div>
  );
};

export default CardItem;
